import './App.css';
import {Home} from './Components/Home/Home';
import {Router, Routes, Route, Link} from "react-router-dom";

function App() {
  return (
    <Router>
      <Link to='/'>Home</Link>
      <Routes>
        <Route path="/" element={<Home />}/>
      </Routes>
    </Router>
    
  );
}

export default App;
